        int[][] cells = new int[1000][1000];
        for (Claim claim: claims) {
            for (int x=claim.left; x<claim.left+claim.width;x++) {
                for (int y=claim.top; y<claim.top+claim.height;y++) {
                    cells[x][y]++;
                }
            }
        }

        int count = 0;
        for (int x=0; x<1000;x++) {
            for (int y=0; y<1000;y++) {
                if (cells[x][y] > 1) {
                    count++;
                }
            }
        }
